import React from "react";
import "./../Styles/home.css";
import { Container, Row, Col } from "reactstrap";
import SubTitle from "../Shared/SubTitle";
import HeroImg from "./../assets/images/Hero-image-1.jpg";
import HeroImg2 from "./../assets/images/Hero-image-2.jpg";
import HeroVideo from "./../assets/images/hero-video.mp4";
import WorldImage from "./../assets/images/world.png";

const Home = () => {
  return (
    <>
      <section>
        <Container>
          <Row>
            <Col lg="6">
              <div className="hero__content">
                <div className="hero__subtile d-flex align-items-center">
                  <SubTitle subTitle={"Where Your Adventures Takes Flight"} />
                  <img src={WorldImage} alt="World Icon Image" />
                  <h1>
                    Embark on Uncharted Journeys: Where Your Adventures Take{" "}
                    <span className="highlight">Flight</span>
                  </h1>
                </div>
              </div>
            </Col>
          </Row>
        </Container>
      </section>
    </>
  );
};

export default Home;
